import { useEffect, useState } from 'react'
import Navbar from '../components/Navbar/Navbar'

export default function Home() {
  const [avocados, setAvocados] = useState([])

  useEffect(() => {
    window
      .fetch('/api/avo')
      .then((response) => response.json())
      .then(({ data, length }) => {
        setAvocados(data)
      })
  }, [])

  return (
    <div>
      <Navbar />
      <h1>Hello, world!</h1>
      {avocados.map((avo) => (
        <li>{avo.name}</li>
      ))}
    </div>
  )
}
